import React, { Suspense } from 'react';
import './App.css';
import { Route, Link, Switch, BrowserRouter as Router } from 'react-router-dom';
import { Nav, Navbar } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
const Contact = React.lazy(() => import('./container/Contact'));
const About = React.lazy(() => import('./container/About'));
const Projects = React.lazy(() => import('./container/Projects'));
const Services = React.lazy(() => import('./container/Services'));
const Home = React.lazy(() => import('./container/Home'));

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar className="navb" collapseOnSelect expand="lg">
          <Navbar.Brand class="navbar-brand"><Link to="/">Portfolio</Link></Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="ml-auto route">
              <Nav.Link><Link to="/about">About</Link></Nav.Link>
              <Nav.Link><Link to="/projects">Projects</Link></Nav.Link>
              <Nav.Link><Link to="/services">Services</Link></Nav.Link>
              <Nav.Link><Link to="/contact">Contact</Link></Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>

        <Suspense fallback={<div>
          sjahgdhjgdhjasfdhjsavgfcjfvshdfvasgdjksbacjh,aschjgfjhsagcdjhasfhjcasvfgchfhsfhjvhjcsfashvgfcjhsfdgsavgxf<br></br>
          hjgjsahgdjkshajcbsahzcvgbmznhvbcjhascgbjhnsbzgcjhasvc<br></br>
          sahjdghjskgbdjhgsjhkcdgskjhcgbhjksghjgc<br></br>
          saDGhjsfgdvjhsghjkgdbhjs<br></br>
          jhsagdhjsgdjhgsbvhjgbdskjhdbgkjhkghsja<br></br>'
          sjhdjhsgxdkshgdjkhgsdkjhsdkg'
        </div>}>
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/about" component={About} />
            <Route path="/projects" component={Projects} />
            <Route path="/services" component={Services} />
            <Route path="/contact" component={Contact} />
          </Switch>
        </Suspense>
      </Router>

      <footer class="page-footer">
        <div class="footer-copyright text-center py-3">Â© 2021 Karan's Portfolio</div>
      </footer>
    </div>
  );
}

export default App;
